import React from "react";
import { useState, useEffect } from "react";
import Leaguetable from "../components/Leaguetable";

const Lastmatcheng = () => {
  const [data, setData] = useState([]);
  const vals = Object.values(data);

  useEffect(() => {
    const options = {
      method: "GET",
      headers: {
        "X-RapidAPI-Key": "b529891cd2mshe7bca90aba3fe87p1dabf4jsnaea3d94ce638",
        "X-RapidAPI-Host": "football98.p.rapidapi.com",
      },
    };

    fetch("https://football98.p.rapidapi.com/premierleague/table", options)
      .then((response) => response.json())
      .then((data) => {
        setData(data);
      })
      .catch((err) => console.error(err));
  }, []);

  return (
    <>
      <div className="text-white shadow-xl absolute top-[180px] right-10 w-[400px] h-[744px] bg-white border-8 border-black-400">
        <div className="w-full h-[12%] flex justify-center items-center  bg-yellow">
          <h1 className="text-black text-2xl ">Premier League 2022/2023</h1>
        </div>
        {data.length > 1 ? (
          ""
        ) : (
          <div className="w-full mt-[250px] flex justify-center items-center">
            <h1 className="text-black text-4xl font-bold">Loading...</h1>{" "}
          </div>
        )}
        {data.length > 1 ? (
          <>
            {" "}
            <div className="flex justify-center w-full ">
              <div className="flex  w-[100%] pr-4 pl-4  h-[40px] justify-between text-black">
                <h1 className=" pl-8 w-[120px]">Squad Name</h1>

                <div className="flex w-[185px] justify-between ">
                  <h1>Pst</h1>
                  <h1 className="">Plyd</h1>
                  <h1>Lost</h1>

                  <h1>Won</h1>
                  <h1>Draw</h1>
                  <h1>Points</h1>
                </div>
              </div>
            </div>
            <div className="h-[80%] w-full  flex-row ">
              {vals.map((item, index) => {
                let className =
                  "flex m-auto w-[100%] pl-4 pr-4 h-[30px] justify-between text-black";
                if (index >= vals.length - 4) {
                  className += " bg-red bg-opacity-80";
                } else if (index <= vals.length - 17) {
                  className += "bg-yellow text-black";
                }
                return (
                  <div className={className}>
                    <div className="w-[145px] flex ">
                      <img src={item.SquadLogo} className="h-[25px] mr-2"></img>
                      {item.Name}
                    </div>
                    <h1>{item.Position}</h1>
                    <h1>{item.Played}</h1>
                    <h1>{item.Loosed}</h1>
                    <h1>{item.Winned}</h1>
                    <h1>{item.Tie}</h1>
                    <h1>{item.Points}</h1>
                  </div>
                );
              })}
            </div>
          </>
        ) : (
          ""
        )}
      </div>
    </>
  );
};

export default Lastmatcheng;
